// SPDX-License-Identifier: MIT
pragma solidity <= 9.0.0;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/utils/Counters.sol";

/**
 * TODO:
 *  - Read ERC721 to understand how the NFT precisely works
 *      https://github.com/OpenZeppelin/openzeppelin-contracts/blob/master/contracts/token/ERC721/ERC721.sol
 *  - Manage all NFTs added via website
 */
contract MarketPlace {

    address private admin;
    uint[] nfts;
    mapping(uint => ERC721) index_nft;

    constructor() {
        admin = msg.sender;
    }

    function addNFT(string memory _name, string memory _symbol) public {
        ERC721 nft = new ERC721(_name, _symbol);
        uint id = nfts.length;
        nfts.push(id);
        index_nft[id] = nft;
    }

    function getNFT(uint _id) public view returns(ERC721) {
        return index_nft[_id];
    }
}
